import React from 'react';
import { Route, Switch } from 'react-router-dom';
import Home from './pages/Home';           // Home page where search happens
import WeatherDetails from './components/WeatherDetails';  // Weather details page
import Settings from './components/Settings';  // Settings page
import AboutUs from './components/AboutUs';  // About Us page
import FeedbackForm from './components/FeedbackForm';  // Feedback Form page

const Routes = () => {
  return (
    <Switch>
      {/* Define routes for different pages */}
      <Route path="/" exact component={Home} />
      <Route path="/details/:weatherAspect" component={WeatherDetails} />
      <Route path="/settings" component={Settings} />
      <Route path="/about" component={AboutUs} />
      <Route path="/feedback" component={FeedbackForm} />
    </Switch>
  );
};

export default Routes;
